import React from 'react';

function WelcomePage() {
  const AUTH_URL = "https://accounts.spotify.com/authorize?client_id=04306bc8614e44bbb0f6f8071bb81e01&response_type=code&redirect_uri=http://localhost:8888/callback&scope=streaming%20user-read-email%20user-read-private%20user-library-read%20user-library-modify%20user-read-playback-state%20user-modify-playback-state";

  return (
    <div>
      <h1>Welcome to Music Match</h1>


      <a className="btn btn-success btn-lg" href={AUTH_URL}>Sign up</a>

      <a className="btn btn-success btn-lg">Log In</a>

    </div >
  );
}

export default WelcomePage;
